import React, { useState } from 'react';
import logo from '../res/main-logo.png';
import projects from '../res/projects-button.png';
import experience from '../res/experience-button.png';
import connect from '../res/connect-button.png';
import './nav.css';

const Nav = () => {
  const [visible, setVisible] = useState(false);

  function toggleNav() {
    setVisible(!visible);
  }

  return (
    <header className="primary">
      <div>
        <img className='logo' src={logo} alt="Stanley Lin"/>
      </div>

      <button className="mobile-nav-toggle" aria-controls="primary-naviation" aria-expanded="false">
        <span className="sr-only">Menu</span>
      </button>

      <nav>
        <ul id="primary-navigation" className={`primary-navigation ${visible ? 'visible' : ''}`}>
          <li><img alt="Projects" src={projects}/></li>
          <li><img alt="Experience" src={experience}/></li>
          <li><img alt="Connect" src={connect}/></li>
        </ul>
      </nav>
    </header>
  );
};

export default Nav
